import React from "react";
import { Switch, Route } from "react-router";
import Environment from "./src/components/Environment";

function Routes() {
  return (
    <Switch>
      {console.log("environment chosen")}
      <Route exact path="/environment" render={() => <Environment />} />
    </Switch>
  );
}
